import PlayerHeading from "../../components/PlayerHeading";

export default function PlayersPage() {
  return (
    <section>
      <PlayerHeading
        playerName={{
          firstName: "Tyrone",
          lastName: "Thompson",
          number: "12",
        }}
      />
      <PlayerHeading
        playerName={{
          firstName: "Ollie",
          lastName: "Norris",
          number: "12",
        }}
      />
    </section>
  );
}
